import Navbar from './Navbar';
import Head from 'next/head';

const Layout = (props) => (
<div>
    <Head>
        <title>Bitcoin Rate</title>
        <link rel="https://bootswatch.com/cerulean/bootstrap.min.css"/>
    </Head>
    <Navbar/>
    {props.children}
</div>

);
export default Layout;
